import React from 'react'
import '../../cssHelper/helper.css';
import './Cart.css'

function Cart() {
  return (
    <div className='Cart-wrapper w-full scroll-hidden'>
      <div className="cart scroll-y scroll-hidden-x grid c-repeat-2 w-full gap-1 p-inline-4 p-block-3">
        <div className="cart-items flex a-center p-1">
            <img src="https://images.hdqwalls.com/wallpapers/white-shirt-girl-4k-jn.jpg" alt="" className='cart-img cover'/>
        </div>
      </div>
    </div>
  )
}

export default Cart
